import classes from './Navigation.module.css'
import Container from 'reactstrap'
const Navigation = () => {
    return (
        <Container className={classes.nav_container}>
            <div className={classes.nav_logo}>
                <img src="" alt="Logo"/>
            </div>
        </Container>
    )
}

export default Navigation
